import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './component.css';
import { connect } from 'react-redux';

class Header extends Component {

    state = {
        isSignUpVisible: false,
    }

    render() {
        const headerStyle = {
            listStyleType: 'none',
            width: "30px",
            height: "20px",
            padding: '30px',
            marginLeft: "20px",
            marginRight: "50px",
            textAlign: "center",
            fontWeight: "bold",
            borderRadius: "3px",
            outline: 'none',
            border: 'solid',
            borderWidth: '5px',
            cursor: 'pointer',
            background: '#fceed1',
            fontFamily: 'FiraSans',
            fontSize: '15px',
            color: '#fff'
        }
        return (
            <header>
                    <nav>
                       <ul>
                           <li  style={headerStyle}><Link to='/home'>Home</Link></li>
                           <li  style={headerStyle}><Link to='/streamingplaza'>Streaming Plaza</Link></li>
                           <li  style={headerStyle} ><Link to='/waitingroom'>Waiting Room</Link></li>
                           <li  style={headerStyle} ><Link to='/profile'>My Profile</Link></li>
                           <li  style={headerStyle} ><Link to='/startstream'>Start a Stream</Link></li>
                           <li  style={headerStyle} ><Link to='/signup'>Sign up</Link></li>
                           <li  style={headerStyle} ><Link to='/login'>Already have an account? Log in</Link></li>
                       </ul>
                   </nav>
            </header>
        )
    }
}

export default Header;
